from algorithm_utils import *

class Solution:
    """
    [5634. 删除子字符串的最大得分]()
    """
    @timeit
    def maximumGain(self, s: str, x: int, y: int) -> int:
        d = {'ab':x, 'ba':y}
        if x > y:
            t, p = 'ab', 'ba'
        else:
            t, p = 'ba', 'ab'
        res = 0
        i = s.find(t)
        while i >= 0:
            s = s[:i] + s[i+2:]
            i = s.find(t, max(0, i-1))
            res += d[t]
        i = s.find(p)
        while i >= 0:
            s = s[:i] + s[i+2:]
            i = s.find(p, max(0, i-1))
            res += d[p]
        return res

if __name__ == '__main__':
    a = Solution()
    a.maximumGain(s = "cdbcbbaaabab", x = 4, y = 5)
    a.maximumGain(s = "aabbaaxybbaabb", x = 5, y = 4)
    s = ""
    a.maximumGain(s, 9150, 6050)